import MoreVertIcon from "@material-ui/icons/MoreVert";

function EmailList() {
  return (
    <div className="emailList">
      <div className="emailList__settings">
        <div className="emailList__settingsLeft">
          <Checkbox />
          <IconButton>
            <ArrowDropDownIcon />
          </IconButton>
          {/* <IconButton>
            <RedoIcon /> 
          </IconButton> */}
          <IconButton>
            <MoreVertIcon />
          </IconButton>
        </div>
      </div>
    </div>
  );
}

export default EmailList;
